Based on the document:

```
const schema = {
    a: Joi.number()
};

const value = {
    a: '123'
};

Joi.validate(value, schema, (err, value) => { });
// err -> null
// value.a -> 123 (number, not string)

// or
const result = Joi.validate(value, schema);
// result.error -> null
// result.value -> { "a" : 123 }
```

The validate should return a result when it takes options argument or not.

Fix tests files that are broken to a recent compiler change (Microsoft/TypeScript#11905).
This is just a quick fix to get tests working, not an ideal solution.
